/*
 * @Author: your name
 * @Date: 2022-03-28 19:45:52
 * @LastEditTime: 2022-03-31 23:33:22
 * @LastEditors: Please set LastEditors
 * @Description: 打开koroFileHeader查看配置 进行设置: https://github.com/OBKoro1/koro1FileHeader/wiki/%E9%85%8D%E7%BD%AE
 * @FilePath: \bl-device-manage-test\src\routes\SpareRouter\index.js
 */
import StandingPage from 'layouts/SpareManage/StandingPage';
import React, { Component } from 'react'
import { SpareManager } from '../../layouts/SpareManage'

export default class index extends Component {
  render() {
    return <SpareManager children={<React.Fragment>
      <Route exact path="/spare" render={() => <Redirect to='/spare/standing' />} />
      <Route path='/spare/standing' component={StandingPage} />
      <Route path='/spare/storage' component={StandingPage} />
      <Route path='/spare/receive' component={StandingPage} />
    </React.Fragment>} />;
    
  }
}
